(110, 7, '2019-06-24 06:58:45', '2019-06-24 06:58:45', 'A 49 runs defeat against Pakistan nullifies South protease’s semi finals chances as they lose 5 of the 7 game played and with 1 win and 1 No result. This is the first time Team South Africa led by Faf Duplessis disappoint with their performance in World Cup.\r\n\r\nPakistan has won the toss and elected to bat first and has scored 308/7 at the end of the innings. All the batsman played well and Haris sohail playing his first match in the tournament has played an destructive innings of 89 runs in just 59 balls .South African bowling display was not up to their mark excluding Imran Tahir spell of 10 overs-41 runs- 2 wickets.\r\n\r\nIn their run chase of 308 runs South Africa has managed to score 259/9 in 50 overs in spite of 8 catch drops and many miss fielding’s from Pakistan.  Except Faf Du plessis63(79) and Quinton de kock 47(60) 87 runs partnership for 2<sup>nd</sup> wicket there was no good contributions as a team from South Africa expect few individual scores. Both Pakistan pacers and spinners has bowled well and Mohammad Amir’s bowling was exceptional.\r\n\r\nThus it is the end for South African Semi final chances and Pakistan was alive as of now but has to concentrate on their fielding to walk into semi finals.', 'End of roads for South Africa and Pakistan is still alive and fighting.', '', 'publish', 'open', 'open', '', 'end-of-roads-for-south-africa-and-pakistan-is-still-alive-and-fighting', '', '', '2019-06-24 07:39:06', '2019-06-24 07:39:06', '', 0, 'https://tenn24.com/?p=110', 0, 'post', '', 0),
