(125, 3, '2019-06-29 06:09:21', '2019-06-29 06:09:21', '<strong>Tirupati News:</strong>\r\n\r\nThe Chief Minister Y.S.Jaganmohan Reddy recently announced the Committees to incorporate APSRTC into the government. The State Transport Minister Perni Venkatramaiah has took the responsibilities Six days ago and announced the launch of 350 electric buses in some cities like Vizag, Vijayawada, Amaravati, Kakinada and Tirupati.\r\n\r\nEarlier, in the year 2018, the former Chief Minister N.Chandrababu Naidu had directed the officials to formulate proposals for operating electric buses between Tirupati and Tirumala and other important cities on a pilot basis. The task force, formed under the chairmanship of Special Chief Secretary (Roads and Buildings), Ajay Jain as convenor and Principal Secretary (MA&amp;UD), Secretary (Industries) and APSRTC Managing Director as members, will study all aspects of launching electric buses.\r\n\r\nThe new Government has looking forward to launch that proposal soon. The State Transport Minister has stated 350 Electric buses are going to be launched in the smart cities of AndhraPradesh.', 'TTD plans to start Trail run of Electric bus in Tirumala Ghat Roads', '', 'publish', 'open', 'open', '', 'ttd-plans-to-start-trail-run-of-electric-bus-in-tirumala-ghat-roads', '', '', '2019-06-29 06:09:21', '2019-06-29 06:09:21', '', 0, 'https://tenn24.com/?p=125', 0, 'post', '', 0),
