(121, 7, '2019-06-27 06:28:34', '2019-06-27 06:28:34', '&nbsp;\r\n\r\nIt’s now been declared that Tirumala Sri Venakateswara Swami will be closed from <strong>7:00 PM on 16<sup>th</sup> of July</strong> as <strong>Lunar eclipse</strong> is about to occur on <strong>17<sup>th</sup> July between 1:31 AM to 4:29 am</strong>. As per <strong>VIkhanasa Agama</strong> practices the temple will be closed <strong>six hours</strong> prior to the occurrence on Eclipse. The temple will be <strong>opened again on 17<sup>th</sup> July at 5:00 AM</strong> with <strong>Suprabatham</strong> to the deity followed by ritual like <strong>Shudhi</strong> (Cleaning), <strong>Punyahavachanam</strong>. Post these rituals, <strong>Thomalaseva, Koluvu, Panchangasravanam, Archana seva’s </strong>will be performed in<strong> Ekantam.</strong> <strong>Sarvadharshanam</strong> will be started from <strong>11:00 AM</strong> on <strong>17<sup>th</sup> July</strong>\r\n<h5>Cancelled Seva’s</h5>\r\nOn 16<sup>th</sup> July, Koyal Alwar Tirumanjanam, Astadhala Padha padmaradhana, Vasantostavam and Sahasra Deepalankarana seva’s were cancelled on the context of Lunar Eclipse.\r\n\r\nOn 17<sup>th</sup> July Kalyanotsavam, Unjalaseva, Arjitha Brahmotsavam, Vasantostavam and Sahasra Deepalankarana seva’s were cancelled on the context of Anivarya Asthanam.', 'Tirumala temple to be closed due to Lunar Eclipse', '', 'publish', 'open', 'open', '', 'tirumala-temple-to-be-closed-due-to-lunar-eclipse', '', '', '2019-06-29 04:42:50', '2019-06-29 04:42:50', '', 0, 'https://tenn24.com/?p=121', 0, 'post', '', 0),
