(127, 3, '2019-06-29 06:09:21', '2019-06-29 06:09:21', '<strong>Tirupati News:</strong>\r\n\r\nThe Chief Minister Y.S.Jaganmohan Reddy recently announced the Committees to incorporate APSRTC into the government. The State Transport Minister Perni Venkatramaiah has took the responsibilities Six days ago and announced the launch of 350 electric buses in some cities like Vizag, Vijayawada, Amaravati, Kakinada and Tirupati.\r\n\r\nEarlier, in the year 2018, the former Chief Minister N.Chandrababu Naidu had directed the officials to formulate proposals for operating electric buses between Tirupati and Tirumala and other important cities on a pilot basis. The task force, formed under the chairmanship of Special Chief Secretary (Roads and Buildings), Ajay Jain as convenor and Principal Secretary (MA&amp;UD), Secretary (Industries) and APSRTC Managing Director as members, will study all aspects of launching electric buses.\r\n\r\nThe new Government has looking forward to launch that proposal soon. The State Transport Minister has stated 350 Electric buses are going to be launched in the smart cities of AndhraPradesh.', 'TTD plans to start Trail run of Electric bus in Tirumala Ghat Roads', '', 'inherit', 'closed', 'closed', '', '125-revision-v1', '', '', '2019-06-29 06:09:21', '2019-06-29 06:09:21', '', 125, 'https://tenn24.com/125-revision-v1/', 0, 'revision', '', 0),
(123, 7, '2019-06-27 06:27:53', '2019-06-27 06:27:53', '&nbsp;\r\n\r\nIt’s now been declared that Tirumala Sri Venakateswara Swami will be closed from <strong>7:00 PM on 16<sup>th</sup> of July</strong> as <strong>Lunar eclipse</strong> is about to occur on <strong>17<sup>th</sup> July between 1:31 AM to 4:29 am</strong>. As per <strong>VIkhanasa Agama</strong> practices the temple will be closed <strong>six hours</strong> prior to the occurrence on Eclipse. The temple will be <strong>opened again on 17<sup>th</sup> July at 5:00 AM</strong> with <strong>Suprabatham</strong> to the deity followed by ritual like <strong>Shudhi</strong> (Cleaning), <strong>Punyahavachanam</strong>. Post these rituals, <strong>Thomalaseva, Koluvu, Panchangasravanam, Archana seva’s </strong>will be performed in<strong> Ekantam.</strong> <strong>Sarvadharshanam</strong> will be started from <strong>11:00 AM</strong> on <strong>17<sup>th</sup> July</strong>\r\n<h5>Cancelled Seva’s</h5>\r\nOn 16<sup>th</sup> July, Koyal Alwar Tirumanjanam, Astadhala Padha padmaradhana, Vasantostavam and Sahasra Deepalankarana seva’s were cancelled on the context of Lunar Eclipse.\r\n\r\nOn 17<sup>th</sup> July Kalyanotsavam, Unjalaseva, Arjitha Brahmotsavam, Vasantostavam and Sahasra Deepalankarana seva’s were cancelled on the context of Anivarya Asthanam.', 'Tirumala temple to be closed due to Lunar Eclipse', '', 'inherit', 'closed', 'closed', '', '121-revision-v1', '', '', '2019-06-27 06:27:53', '2019-06-27 06:27:53', '', 121, 'https://tenn24.com/121-revision-v1/', 0, 'revision', '', 0),
