(84, 3, '2019-06-22 17:12:34', '2019-06-22 17:12:34', '<strong>News Tirumala:</strong>\r\n\r\nAndhra Pradesh Chief Minister YS Jagan Mohan Reddy appointed Mr. YV Subba Reddy as a Chairman for Tirumala Tirupati Devasthanams Board (TTD).\r\n\r\nYV Subba Reddy’s took charge on Saturday at 11 AM as TTD Board Chairman in Tirumala after the resignation of former TTD chairman Putta Subhakar Reddy, who was appointed by the Chandrababu Naidu- Former CM of Andhra Pradesh and led Telugu Desam Party (TDP) government.\r\n\r\nTirumala Tirupati Devasthanams is one of the biggest Trust body in India, Which takes complete management of the Tirumala Venkateswara Temple, richest Hindhu temple in the world. And TTD Board organize various festivals and event in Tirumala Temple and Temple in Tirupati which associates with TTD.\r\n\r\nThe TTD chairmanship holds a largest demand in Andhra Pradesh, and Government of Andhra Pradesh appoint and operate the Board of TTD Trust. People in Local bodies and finacial supporters of AP Govt would have more chance to get opportunity in this Board.\r\n\r\nYV Subba Reddy, who is also party general secretary, won as YSRCP MP from Ongole, Prakasam district, in the 2014 national elections.\r\n\r\nAs per sources, the newly elected YCP government has looking to form complete Governing Council of the temple and a new management within four days.', 'TTD New Chairman Takes Charge', '', 'publish', 'open', 'open', '', 'ttd-new-chairman-takes-charge', '', '', '2019-06-22 17:14:52', '2019-06-22 17:14:52', '', 0, 'https://tenn24.com/?p=84', 0, 'post', '', 0),
