(86, 3, '2019-06-22 17:12:34', '2019-06-22 17:12:34', '<strong>News Tirumala:</strong>\r\n\r\nAndhra Pradesh Chief Minister YS Jagan Mohan Reddy appointed Mr. YV Subba Reddy as a Chairman for Tirumala Tirupati Devasthanams Board (TTD).\r\n\r\nYV Subba Reddy’s took charge on Saturday at 11 AM as TTD Board Chairman in Tirumala after the resignation of former TTD chairman Putta Subhakar Reddy, who was appointed by the Chandrababu Naidu- Former CM of Andhra Pradesh and led Telugu Desam Party (TDP) government.\r\n\r\nTirumala Tirupati Devasthanams is one of the biggest Trust body in India, Which takes complete management of the Tirumala Venkateswara Temple, richest Hindhu temple in the world. And TTD Board organize various festivals and event in Tirumala Temple and Temple in Tirupati which associates with TTD.\r\n\r\nThe TTD chairmanship holds a largest demand in Andhra Pradesh, and Government of Andhra Pradesh appoint and operate the Board of TTD Trust. People in Local bodies and finacial supporters of AP Govt would have more chance to get opportunity in this Board.\r\n\r\nYV Subba Reddy, who is also party general secretary, won as YSRCP MP from Ongole, Prakasam district, in the 2014 national elections.\r\n\r\nAs per sources, the newly elected YCP government has looking to form complete Governing Council of the temple and a new management within four days.', 'TTD New Chairman Takes Charge', '', 'inherit', 'closed', 'closed', '', '84-revision-v1', '', '', '2019-06-22 17:12:34', '2019-06-22 17:12:34', '', 84, 'https://tenn24.com/84-revision-v1/', 0, 'revision', '', 0),
(87, 3, '2019-06-23 17:39:22', '2019-06-23 17:39:22', '<strong>The game changing 29th over</strong>\r\n\r\nAfter restricting india for 224 turns with their bowling brilliance, Afghanistan has laid a strong foundation in their run chase too with 106runs for lose of 2 wickets after 27 overs and were 118 runs away for a mega upsets of the tournament. The game is well poised towards Afghan and it seemed to be a history at making. With two set batsman Rahmat at 36 (59)and shahidi at 21 (43)\r\n\r\nBut, bumrah in 29th over (2nd over of his second spell) of the innings has once again stood up to his captains expectations with double strokes and a maiden over.\r\nFirst ball itself is an LBW but the umpire was not convinced with it then comes 2 more dot balls making the batsmen Rahmat uncomfortable and then comes the short Ball with bumrahs timing trick forced Rahmat for a pull shot with a top edge and Chahal has collected a diving catch.\r\nShahidi comes to crease as both the batsmen crossed each other before the catch.\r\n\r\nShahidi then had a dot ball but has failed to with stand the magic of bumrah in the last ball, I.e., short of the length, right into the body. Batman hops at the ball and closes the bat face as there pops the leading edge and bumrah himself manages to run and pick a low catch on the pitch\r\n\r\nBumrah has put halt to the Afghan momentum in just one over by dismissing 2 set batsman. India managed to win the match by 11 runs and bumrah for his bowling brilliance trough out (10 overs-39 runs-2 wickets) was awarded with man of the match.', 'Bumrah twin strokes', '', 'publish', 'open', 'open', '', 'bumrah-twin-strokes', '', '', '2019-06-24 12:38:17', '2019-06-24 12:38:17', '', 0, 'https://tenn24.com/?p=87', 0, 'post', '', 0),
