(89, 3, '2019-06-23 17:39:22', '2019-06-23 17:39:22', '<strong>The game changing 29th over</strong>\r\n\r\nAfter restricting india for 224 turns with their bowling brilliance, Afghanistan has laid a strong foundation in their run chase too with 106runs for lose of 2 wickets after 27 overs and were 118 runs away for a mega upsets of the tournament. The game is well poised towards Afghan and it seemed to be a history at making. With two set batsman Rahmat at 36 (59)and shahidi at 21 (43)\r\n\r\nBut, bumrah in 29th over (2nd over of his second spell) of the innings has once again stood up to his captains expectations with double strokes and a maiden over.\r\nFirst ball itself is an LBW but the umpire was not convinced with it then comes 2 more dot balls making the batsmen Rahmat uncomfortable and then comes the short Ball with bumrahs timing trick forced Rahmat for a pull shot with a top edge and Chahal has collected a diving catch.\r\nShahidi comes to crease as both the batsmen crossed each other before the catch.\r\n\r\nShahidi then had a dot ball but has failed to with stand the magic of bumrah in the last ball, I.e., short of the length, right into the body. Batman hops at the ball and closes the bat face as there pops the leading edge and bumrah himself manages to run and pick a low catch on the pitch\r\n\r\nBumrah has put halt to the Afghan momentum in just one over by dismissing 2 set batsman. India managed to win the match by 11 runs and bumrah for his bowling brilliance trough out (10 overs-39 runs-2 wickets) was awarded with man of the match.', 'Bumrah twin strokes', '', 'inherit', 'closed', 'closed', '', '87-revision-v1', '', '', '2019-06-23 17:39:22', '2019-06-23 17:39:22', '', 87, 'https://tenn24.com/87-revision-v1/', 0, 'revision', '', 0),
(116, 3, '2019-06-24 08:16:54', '2019-06-24 08:16:54', '<h2>AP Jobs..</h2>\nPanchayat raj Deparment of Government of Andhra Pradesh in the leadership of Sri Y.S. Jagan Mohan Reddy has released notification for the recruitment of Grama Volunteers in 13 districts of Andhra Pradesh.\n\nChief Minister on the day of taking oat has promised to fulfill his election promise of creating Grama Volunteer jobs by 15<sup>th</sup> August 2019. To revamp delivery systems in the State with an aim to improve living standards of the people , Government intends to deploy Volunteers in rural areas for delivering Government Services at door step of all eligible households irrespective of Caste/Creed/Religion/Gender and political affiliation. This system will ensure leak proof implementation of Government Programs/Schemes. The objective of positioning Village Volunteers is to ensure timely and transparent services, to eliminate the corruption at all levels of administration. Village Volunteers will identify the problems being faced by anybody in his jurisdiction and the same will be brought to the notice of Gram Panchayat and then get them resolved. Applicants within the age group of 18 to 35 years were eligible and minimum education qualification is intermediate and 10<sup>th</sup> class in tribal areas/ agencies. 50% of posts in each category is reserved for woman. An honorarium of 5000/- per month per volunteer will be paid. This program costs 1200cr per annum towards honorarium and 13.5 crores towards training and recruitment process.\n<h5>Time line for selection</h5>\nReceipt of application                                                    24-06-2019 to 05-07-2019\nScrutiny of applications                                                 10-07-2019\nInterviews by Selection Committee                         11-07-2019 to 25-07-2019\nIntimation letters to selected Volunteers.            01-08-2019\nInduction and training program                                05-08-2019 to 10-08-2019\npositioning of volunteers                                             15-08-2019\n<h5>To apply please click here</h5>\n<a href="http://gramavolunteer.ap.gov.in/GRAMAVAPP/VV/index.html">http://gramavolunteer.ap.gov.in/GRAMAVAPP/VV/index.html</a>\n<h5>To check the notification please check here</h5>\n<a href="http://gramavolunteer.ap.gov.in/GRAMAVAPP/Links/GO.pdf">http://gramavolunteer.ap.gov.in/GRAMAVAPP/Links/GO.pdf</a>', 'Grama/ ward volunteer jobs in Andhra Pradesh…!', '', 'inherit', 'closed', 'closed', '', '113-autosave-v1', '', '', '2019-06-24 08:16:54', '2019-06-24 08:16:54', '', 113, 'https://tenn24.com/113-autosave-v1/', 0, 'revision', '', 0),
