(119, 3, '2019-06-24 08:18:21', '2019-06-24 08:18:21', '<h2>AP Jobs..</h2>\r\nPanchayat raj Deparment of Government of Andhra Pradesh in the leadership of Sri Y.S. Jagan Mohan Reddy has released notification for the recruitment of Grama Volunteers in 13 districts of Andhra Pradesh.\r\n\r\nChief Minister on the day of taking oat has promised to fulfill his election promise of creating Grama Volunteer jobs by 15<sup>th</sup> August 2019. To revamp delivery systems in the State with an aim to improve living standards of the people , Government intends to deploy Volunteers in rural areas for delivering Government Services at door step of all eligible households irrespective of Caste/Creed/Religion/Gender and political affiliation. This system will ensure leak proof implementation of Government Programs/Schemes. The objective of positioning Village Volunteers is to ensure timely and transparent services, to eliminate the corruption at all levels of administration. Village Volunteers will identify the problems being faced by anybody in his jurisdiction and the same will be brought to the notice of Gram Panchayat and then get them resolved. Applicants within the age group of 18 to 35 years were eligible and minimum education qualification is intermediate and 10<sup>th</sup> class in tribal areas/ agencies. 50% of posts in each category is reserved for woman. An honorarium of 5000/- per month per volunteer will be paid. This program costs 1200cr per annum towards honorarium and 13.5 crores towards training and recruitment process.\r\n<h5>Time line for selection</h5>\r\n<table dir="ltr" style="height: 214px;" border="1" width="560" cellspacing="0" cellpadding="0"><colgroup> <col width="242" /> <col width="161" /></colgroup>\r\n<tbody>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;Receipt of application &quot;}">Receipt of application</td>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;24-06-2019 to 05-07-2019&quot;}">24-06-2019 to 05-07-2019</td>\r\n</tr>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;Scrutiny of applications &quot;}">Scrutiny of applications</td>\r\n<td data-sheets-value="{&quot;1&quot;:3,&quot;3&quot;:43745}" data-sheets-numberformat="{&quot;1&quot;:5,&quot;2&quot;:&quot;mm-dd-yyyy&quot;,&quot;3&quot;:1}">10-07-2019</td>\r\n</tr>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;Interviews by Selection Committee &quot;}">Interviews by Selection Committee</td>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;11-07-2019 to 25-07-2019&quot;}">11-07-2019 to 25-07-2019</td>\r\n</tr>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;Intimation letters to selected Volunteers. &quot;}">Intimation letters to selected Volunteers.</td>\r\n<td data-sheets-value="{&quot;1&quot;:3,&quot;3&quot;:43473}" data-sheets-numberformat="{&quot;1&quot;:5,&quot;2&quot;:&quot;mm-dd-yyyy&quot;,&quot;3&quot;:1}">01-08-2019</td>\r\n</tr>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;Induction and training program &quot;}">Induction and training program</td>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;05-08-2019 to 10-08-2019&quot;}">05-08-2019 to 10-08-2019</td>\r\n</tr>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;positioning of volunteers &quot;}">Positioning of volunteers</td>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;15-08-2019&quot;}">15-08-2019</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h5>To apply please click here</h5>\r\n<a href="http://gramavolunteer.ap.gov.in/GRAMAVAPP/VV/index.html">http://gramavolunteer.ap.gov.in/GRAMAVAPP/VV/index.html</a>\r\n<h5>To check the notification please check here</h5>\r\n<a href="http://gramavolunteer.ap.gov.in/GRAMAVAPP/Links/GO.pdf">http://gramavolunteer.ap.gov.in/GRAMAVAPP/Links/GO.pdf</a>', 'Grama/ ward volunteer jobs in Andhra Pradesh…!', '', 'inherit', 'closed', 'closed', '', '113-revision-v1', '', '', '2019-06-24 08:18:21', '2019-06-24 08:18:21', '', 113, 'https://tenn24.com/113-revision-v1/', 0, 'revision', '', 0),
