(1060, 0, '2019-10-14 11:43:36', '2019-10-14 11:43:36', '<img src="https://telugu.samayam.com/photo/71580671/photo-71580671.jpg"><div><div>&#3118;&#3112; &#3110;&#3095;&#3149;&#3095;&#3120; &#3122;&#3117;&#3149;&#3119;&#3118;&#3119;&#3149;&#3119;&#3143;  &#3098;&#3143;&#3114;&#3122; &#3114;&#3149;&#3120;&#3108;&#3149;&#3119;&#3143;&#3093;&#3108; &#3108;&#3142;&#3122;&#3137;&#3128;&#3137; &#3093;&#3110;&#3134;. &#3079;&#3110;&#3135; &#3112;&#3136;&#3120;&#3137; &#3122;&#3143;&#3093;&#3114;&#3147;&#3119;&#3135;&#3112;&#3134;.. &#3116;&#3137;&#3120;&#3110;&#3122;&#3147;&#3112;&#3144;&#3112;&#3134; &#3116;&#3108;&#3093;&#3095;&#3122;&#3110;&#3137;. &#3093;&#3146;&#3120;&#3149;&#3120;&#3118;&#3143;&#3112;&#3137; &#3122;&#3134;&#3074;&#3103;&#3135; &#3098;&#3143;&#3114;&#3112;&#3137; &#3098;&#3138;&#3128;&#3135; &#3077;&#3118;&#3142;&#3120;&#3135;&#3093;&#3134; &#3129;&#3105;&#3122;&#3135;&#3114;&#3147;&#3108;&#3147;&#3074;&#3110;&#3135;. &#3128;&#3149;&#3112;&#3143;&#3093;&#3149; &#3115;&#3135;&#3127;&#3149;&zwnj;&#3095;&#3134; &#3114;&#3135;&#3122;&#3135;&#3098;&#3143; &#3080; &#3098;&#3143;&#3114; &#3077;&#3118;&#3142;&#3120;&#3135;&#3093;&#3112;&#3149;&#3122;&#3112;&#3137; &#3117;&#3119;&#3114;&#3142;&#3105;&#3137;&#3108;&#3147;&#3074;&#3110;&#3135;. &#3079;&#3110;&#3135; &#3117;&#3138;&#3118;&#3135; &#3118;&#3136;&#3110; &#3114;&#3134;&#3093;&#3137;&#3108;&#3138; &#3090;&#3093; &#3112;&#3136;&#3103;&#3135; &#3118;&#3105;&#3137;&#3095;&#3137; &#3112;&#3137;&#3074;&#3098;&#3135; &#3118;&#3120;&#3147; &#3118;&#3105;&#3137;&#3095;&#3137;&#3093;&#3137; &#3114;&#3149;&#3120;&#3119;&#3134;&#3107;&#3135;&#3074;&#3098;&#3095;&#3122;&#3110;&#3137;. &#3112;&#3136;&#3123;&#3149;&#3122;&#3137; &#3122;&#3143;&#3093;&#3137;&#3112;&#3149;&#3112;&#3134; &#3095;&#3134;&#3122;&#3135;&#3112;&#3135; &#3114;&#3136;&#3122;&#3137;&#3128;&#3149;&#3108;&#3138; &#3116;&#3108;&#3135;&#3093;&#3143;&#3119;&#3095;&#3122;&#3110;&#3137;. &#3080; &#3098;&#3143;&#3114; &#3093;&#3112;&#3135;&#3114;&#3135;&#3074;&#3098;&#3095;&#3134;&#3112;&#3143; &#3098;&#3074;&#3114;&#3143;&#3119;&#3074;&#3105;&#3112;&#3135; &#3077;&#3111;&#3135;&#3093;&#3134;&#3120;&#3137;&#3122;&#3137; &#3114;&#3149;&#3120;&#3100;&#3122;&#3112;&#3137; &#3093;&#3147;&#3120;&#3137;&#3108;&#3137;&#3112;&#3149;&#3112;&#3134;&#3120;&#3137;.\n\n&#3086;&#3074;&#3110;&#3137;&#3093;&#3116;&#3149;&#3116;&#3134;.. &#3077;&#3112;&#3137;&#3093;&#3137;&#3074;&#3103;&#3137;&#3112;&#3149;&#3112;&#3134;&#3120;&#3134;? &#3080; &#3128;&#3149;&#3112;&#3143;&#3093;&#3149; &#3115;&#3135;&#3127;&#3149; &#3110;&#3142;&#3116;&#3149;&#3116;&#3093;&#3137; &#3128;&#3149;&#3109;&#3134;&#3112;&#3135;&#3093;&#3074;&#3095;&#3134; &#3081;&#3074;&#3105;&#3143; &#3098;&#3143;&#3114;&#3122;&#3093;&#3137; &#3118;&#3137;&#3114;&#3149;&#3114;&#3137; &#3125;&#3134;&#3103;&#3135;&#3122;&#3149;&#3122;&#3137;&#3108;&#3147;&#3074;&#3110;&#3103;. &#3079;&#3125;&#3135; &#3125;&#3143;&#3095;&#3074;&#3095;&#3134; &#3108;&#3118; &#3128;&#3074;&#3108;&#3108;&#3135;&#3112;&#3135; &#3114;&#3142;&#3074;&#3098;&#3137;&#3093;&#3137;&#3074;&#3103;&#3138;.. &#3079;&#3108;&#3120; &#3100;&#3134;&#3108;&#3135; &#3098;&#3143;&#3114;&#3122;&#3137;, &#3100;&#3122;&#3098;&#3120;&#3134;&#3122;&#3112;&#3137; &#3108;&#3135;&#3112;&#3143;&#3128;&#3149;&#3108;&#3137;&#3112;&#3149;&#3112;&#3134;&#3119;&#3103;. &#3108;&#3118; &#3114;&#3135;&#3122;&#3149;&#3122;&#3122; &#3100;&#3147;&#3122;&#3135;&#3093;&#3135; &#3125;&#3098;&#3149;&#3098;&#3143; &#3079;&#3108;&#3120; &#3100;&#3136;&#3125;&#3137;&#3122; &#3077;&#3074;&#3108;&#3137; &#3098;&#3138;&#3128;&#3149;&#3108;&#3137;&#3112;&#3149;&#3112;&#3134;&#3119;&#3103;. &#3110;&#3136;&#3074;&#3108;&#3147; &#3100;&#3136;&#3125; &#3125;&#3144;&#3125;&#3135;&#3111;&#3149;&#3119;&#3074; &#3110;&#3142;&#3116;&#3149;&#3116;&#3108;&#3135;&#3074;&#3103;&#3147;&#3074;&#3110;&#3112;&#3135; &#3077;&#3111;&#3135;&#3093;&#3134;&#3120;&#3137;&#3122;&#3137; &#3125;&#3134;&#3114;&#3147;&#3108;&#3137;&#3112;&#3149;&#3112;&#3134;&#3120;&#3137;. &#3118;&#3146;&#3108;&#3149;&#3108;&#3074; 15 &#3120;&#3134;&#3127;&#3149;&#3103;&#3149;&#3120;&#3134;&#3122;&#3149;&#3122;&#3147; &#3080; &#3098;&#3143;&#3114;&#3122;&#3137; &#3081;&#3112;&#3149;&#3112;&#3103;&#3149;&#3103;&#3137; &#3095;&#3137;&#3120;&#3149;&#3108;&#3135;&#3074;&#3098;&#3134;&#3120;&#3137;. &#3079;&#3103;&#3136;&#3125;&#3122;&#3143; &#3108;&#3146;&#3122;&#3135;&#3128;&#3134;&#3120;&#3135;&#3095;&#3134; &#3100;&#3134;&#3120;&#3149;&#3100;&#3135;&#3119;&#3134;&#3122;&#3147;&#3112;&#3138; &#3080; &#3098;&#3143;&#3114;&#3112;&#3137; &#3095;&#3137;&#3120;&#3149;&#3108;&#3135;&#3074;&#3098;&#3134;&#3120;&#3137;.\n\n&#3125;&#3134;&#3128;&#3149;&#3108;&#3125;&#3134;&#3112;&#3135;&#3093;&#3135; &#3079;&#3125;&#3135; &#3077;&#3118;&#3142;&#3120;&#3135;&#3093;&#3134;&#3093;&#3137; &#3098;&#3142;&#3074;&#3110;&#3135;&#3112; &#3098;&#3143;&#3114;&#3122;&#3137; &#3093;&#3134;&#3110;&#3137;. &#3078;&#3128;&#3135;&#3119;&#3134; &#3114;&#3149;&#3120;&#3134;&#3074;&#3108;&#3074; &#3112;&#3137;&#3074;&#3098;&#3135; &#3079;&#3125;&#3135; &#3077;&#3118;&#3142;&#3120;&#3135;&#3093;&#3134;&#3122;&#3147; &#3077;&#3105;&#3137;&#3095;&#3137;&#3114;&#3142;&#3103;&#3149;&#3103;&#3134;&#3119;&#3135;. 2002&#3122;&#3147; &#3077;&#3118;&#3142;&#3120;&#3135;&#3093;&#3134; &#3080; &#3100;&#3134;&#3108;&#3135; &#3098;&#3143;&#3114;&#3122;&#3114;&#3144; &#3112;&#3135;&#3127;&#3143;&#3111;&#3074; &#3125;&#3135;&#3111;&#3135;&#3074;&#3098;&#3135;&#3074;&#3110;&#3135;. &#3079;&#3108;&#3120; &#3100;&#3136;&#3125;&#3137;&#3122;&#3093;&#3137; &#3129;&#3134;&#3112;&#3135; &#3093;&#3122;&#3135;&#3095;&#3135;&#3128;&#3149;&#3108;&#3137;&#3112;&#3149;&#3112;&#3134;&#3119;&#3112;&#3143; &#3093;&#3134;&#3120;&#3107;&#3074;&#3108;&#3147; &#3125;&#3134;&#3103;&#3135; &#3120;&#3125;&#3134;&#3107;&#3134;&#3114;&#3144; &#3078;&#3074;&#3093;&#3149;&#3127;&#3122;&#3137; &#3125;&#3135;&#3111;&#3135;&#3074;&#3098;&#3135;&#3074;&#3110;&#3135;.\n\n</div></div>', 'అమెరికాను హడలెత్తిస్తున్న కొర్రమేను చేప.. కనపడగానే చంపేయాలని ఆదేశాలు!', 'Murrel Fish | కొర్రమేను జాతికి చెందిన చేప అమెరికాను హడలెత్తిస్తోంది. ఈ చేప కనిపించగానే చంపేయండని అక్కడి అధికారులు ఆదేశాలు జారీ చేశారు. స్థానిక చేపలకు దీని నుంచి ముప్పు ఎదురవుతుండటమే దీనికి కారణం.', 'publish', 'closed', 'closed', '', '%e0%b0%85%e0%b0%ae%e0%b1%86%e0%b0%b0%e0%b0%bf%e0%b0%95%e0%b0%be%e0%b0%a8%e0%b1%81-%e0%b0%b9%e0%b0%a1%e0%b0%b2%e0%b1%86%e0%b0%a4%e0%b1%8d%e0%b0%a4%e0%b0%bf%e0%b0%b8%e0%b1%8d%e0%b0%a4%e0%b1%81%e0%b0%a8', '', '', '2019-10-14 11:43:36', '2019-10-14 11:43:36', '', 0, 'https://tenn24.com/?post_type=wprss_feed_item&p=1060', 0, 'wprss_feed_item', '', 0);
