(4847, 0, '2020-03-24 07:50:17', '2020-03-24 07:50:17', '<img src="https://telugu.samayam.com/photo/74789253/photo-74789253.jpg"><div><div> &#3118;&#3120;&#3147; &#3093;&#3137;&#3103;&#3137;&#3074;&#3116;&#3074;&#3122;&#3147; &#3098;&#3135;&#3098;&#3149;&#3098;&#3137; &#3120;&#3143;&#3114;&#3135;&#3074;&#3110;&#3135;. &#3117;&#3120;&#3149;&#3108; &#3093;&#3123;&#3149;&#3122;&#3137;&#3095;&#3114;&#3149;&#3114;&#3135; &#3086;&#3112;&#3149;&#3112;&#3134;&#3123;&#3149;&#3122; &#3112;&#3137;&#3074;&#3098;&#3143; &#3114;&#3149;&#3120;&#3135;&#3119;&#3137;&#3105;&#3135;&#3108;&#3147; &#3120;&#3134;&#3128;&#3122;&#3136;&#3122;&#3122;&#3137; &#3128;&#3134;&#3095;&#3135;&#3128;&#3149;&#3108;&#3137;&#3112;&#3149;&#3112; &#3117;&#3134;&#3120;&#3149;&#3119; &#3116;&#3074;&#3105;&#3134;&#3120;&#3074; &#3078;&#3110;&#3135;&#3125;&#3134;&#3120;&#3074; &#3100;&#3112;&#3108;&#3134; &#3093;&#3120;&#3149;&#3115;&#3149;&#3119;&#3138; &#3093;&#3134;&#3120;&#3107;&#3074;&#3095;&#3134; &#3116;&#3103;&#3149;&#3103;&#3116;&#3119;&#3122;&#3144;&#3074;&#3110;&#3135;. &#3081;&#3110;&#3149;&#3119;&#3147;&#3095;&#3074; &#3112;&#3135;&#3118;&#3135;&#3108;&#3149;&#3108;&#3074; &#3125;&#3143;&#3120;&#3143; &#3114;&#3149;&#3120;&#3134;&#3074;&#3108;&#3074;&#3122;&#3147; &#3081;&#3074;&#3103;&#3137;&#3112;&#3149;&#3112; &#3117;&#3120;&#3149;&#3108; &#3093;&#3120;&#3149;&#3115;&#3149;&#3119;&#3138; &#3093;&#3134;&#3120;&#3107;&#3074;&#3095;&#3134; &#3078;&#3110;&#3135;&#3125;&#3134;&#3120;&#3074; &#3079;&#3074;&#3103;&#3135;&#3093;&#3143; &#3114;&#3120;&#3135;&#3118;&#3135;&#3108;&#3118;&#3119;&#3149;&#3119;&#3134;&#3105;&#3137;. &#3110;&#3136;&#3074;&#3108;&#3147; &#3078; &#3120;&#3147;&#3100;&#3137; &#3117;&#3134;&#3120;&#3149;&#3119; &#3128;&#3142;&#3122;&#3149;&zwnj;&#3115;&#3147;&#3112;&#3149;&#3122;&#3147; &#3095;&#3143;&#3118;&#3149; &#3078;&#3105;&#3137;&#3108;&#3138; &#3078;&#3118;&#3142; &#3125;&#3134;&#3103;&#3149;&#3128;&#3134;&#3114;&#3149;&zwnj; &#3098;&#3142;&#3093;&#3149; &#3098;&#3143;